import React from "react";
import "./Navbar.css";

const Navbar = props => (

    <nav className="nav-bar">

        <div>The Clicky Game</div>

      <div>{props.rightWrong}</div> 

      <div className="current-score">Current Score: {props.score}
      High Score: {props.highscore}</div> 


    </nav>
)
export default Navbar;
